import React from "react";

export default function MostPicked(props) {
  return (
    <section className="px-36">
      <h4 className="text-2xl mb-5">Most Picked</h4>
      <div className="grid grid-rows-2 grid-flow-col gap-7">
        {props.data?.map((item, index) => {
          return (
            <div
              className={
                index === 0 ? `min-h-[215px] row-span-2` : `min-h-[215px]`
              }
            >
              <div className=" bg-magenta text-white font-medium z-10 px-10 py-2">
                ${item.price}{" "}
                <span className="font-light text-white">per {item.unit}</span>
              </div>
              <figure className="object-cover">
                <img src={item.imageUrl} alt={item.name}></img>
              </figure>
            </div>
          );
        })}
      </div>
    </section>
  );
}
